function Expense(){
  return  (
    
         <div className="expense-item">
             <div >20 Nov 2020   </div>
           <div className='expense-item__description' >
               <h2 >Bike petrol</h2>
           
           <div className="expense-item__price ">$1300</div>
           </div>


    </div>  
)}

export default Expense;
